INSERT INTO `TextBody` VALUES (1,'\n<p>Welcome to EarthFluent!  Here you can take free, online lessons to learn some of the most used languages in the world.  You may study Spanish, French, Italian, German, Japanese, Chinese, Hindi, Indonesian, Dutch, Polish, Portuguese, Russian, or Korean.</p>\r\n\r\n<p>Go on, join the global conversation!</p>\n','','',44,308,1,'2017-04-07 16:41:55','2017-04-26 16:25:00'),(2,'\n<p>Here you can learn how to speak Spanish!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,124,2,'2017-04-07 17:28:56','2017-04-27 17:08:50'),(3,'\n<p>Here you can learn how to speak French!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,123,3,'2017-04-08 17:05:07','2017-04-27 17:18:55'),(4,'\n<p>Here you can learn how to speak Italian!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,124,4,'2017-04-09 09:43:54','2017-04-27 17:19:51'),(5,'\n<p>Here you can learn how to speak German!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,123,5,'2017-04-09 17:18:53','2017-04-27 17:23:30'),(6,'\n<p>Here you can learn how to speak Japanese!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,125,6,'2017-04-10 16:06:46','2017-04-27 17:24:18'),(7,'\n<p>Here you can learn how to speak Chinese!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,124,7,'2017-04-10 16:18:42','2017-04-28 16:20:33'),(8,'\n<p>Here you can learn how to speak Hindi!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,122,8,'2017-04-10 16:22:50','2017-04-28 16:21:33'),(9,'\n<p>Here you can learn how to speak Indonesian!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,127,9,'2017-04-10 16:50:28','2017-04-28 16:23:38'),(10,'\n<p>Here you can learn how to speak Dutch!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,122,10,'2017-04-10 16:52:11','2017-04-28 16:29:09'),(11,'\n<p>Here you can learn how to speak Polish!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,123,11,'2017-04-10 16:57:16','2017-04-28 16:38:51'),(12,'\n<p>Here you can learn how to speak Portuguese!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,127,12,'2017-04-10 17:02:59','2017-04-28 16:45:02'),(13,'\n<p>Here you can learn how to speak Russian!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,124,13,'2017-04-10 17:04:45','2017-04-28 16:58:26'),(14,'\n<p>Here you can learn how to speak Korean!</p>\r\n\r\n<p>Lessons are divided into sections: nouns, verbs, and adjectives.</p>\n','','',17,123,143,'2017-04-26 16:22:40','2017-04-28 17:08:19');
